I've had a look at the patch and the general idea looks correct. However, I think you should not be testing for "ready" before returning the value. What ready says is that there are buffered contents available in the underlying reader so the read will not block. However, it doesn't say that there aren't more characters coming. Under certain circumstances, I believe the code in the patch could return a single line as two separate lines. I think the text you are looking for is something like this:

int c = br.read();
if (c == -1)
   // there is no more to read

